                </table>
        )
    } else if (r.gol_O21 === r.gol_O22) {
        return (
            <table>
                <tr>
                    <td align="right">{class_oitavas[1]}</td>
                    <td align="center">{r.gol_O21} ({r.penaltiO21}) x ({r.penaltiO22}) {r.gol_O21}</td>
                    <td align="left">{class_oitavas[3]}</td>
